import React from 'react';
import Home from './pages/Home';
import background from './assets/background.svg'; // Adjust the path as needed

function App() {
  return (
    <div className="relative min-h-screen" style={{ backgroundImage: `url(${background})`, backgroundSize: 'cover', backgroundPosition: 'center', backgroundRepeat: 'no-repeat' }}>
      <div className="relative z-10">
        <Home />
      </div>
    </div>
  );
}

export default App;
